import ExpenseItem from "./components/JS/ExpenseItems";
function App() {
  const dataExpenses = [{
    id:'I1',
    title:'Item 1',
    amount: 94.15,
    date: new Date(2021,7,14)
  },{
    id:'I2',
    title:'Item 2',
    amount: 45.96,
    date: new Date(2022,8,21)
  },{
    id:'I3',
    title:'Item 3',
    amount: 91.46,
    date: new Date(2022,2,5)
  }];

  return (
    <div>
      <ExpenseItem title={dataExpenses[0].title} amount={dataExpenses[0].amount} date={dataExpenses[0].date}/>
      <ExpenseItem title={dataExpenses[1].title} amount={dataExpenses[1].amount} date={dataExpenses[1].date}/>
      <ExpenseItem title={dataExpenses[2].title} amount={dataExpenses[2].amount} date={dataExpenses[2].date}/>
    </div>
  );
}

export default App;
